import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { BsCamera } from 'react-icons/bs';
import useAuth from '../../hooks/useAuth';
import Header from '../Shared/Header/Header'
import './UserProfile.css';

const UserProfile = () => {
    const { user } = useAuth();
    return (
        <div>
            <Header />
            <div className="user-profile">
                <Container className="user-cover-img-container" fluid>
                    <Row>
                        <Col className="m-0 p-0">
                            <img className="img-fluid w-100" src="http://www.wpkixx.com/html/winku-dark/images/resources/timeline-1.jpg" alt="Cover_Photo" />
                        </Col>
                    </Row>
                </Container>
                <Container className="user-profile-img-container" fluid>
                    <Row>
                        <div>
                            <img className="img-fluid w-100" src="http://www.wpkixx.com/html/winku-dark/images/resources/user-avatar.jpg" alt="Cover_Photo" />
                        </div>
                    </Row>
                </Container>
            </div>

        </div >
    );
};

export default UserProfile;
